import React from 'react';
import { Bar } from 'react-chartjs-2';
import { 
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend, } from 'chart.js';

import './styles/PostsContainerPostsView.css'

ChartJS.register(
    Bar,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
  )

const PostsContainerGraphView = ({ posts, headers }) => {
    const data = {
        labels: ['1', '2', '3'],
        datasets: [
            {
                label: 'datset 1',
                data: [1,2,3]
            }
        ]
    }

    return (
        <div className="PostsContainerGraphView">
            <Bar data={data}/>
        </div>
    );
}

export default PostsContainerGraphView;
